import React, {Component} from "react";

class BookmarkItem extends Component {
    render() {
        const {bookmark} = this.props;
        return (<div>
            <tr>
                <td>{bookmark.name}</td>
                <td>{bookmark.rating}</td>
                <td>
                    <form>
                        <button>Edit</button>
                        <button>Delete</button>
                    </form>
                </td>
            </tr>
            </div>
        );
    }
}

export default BookmarkItem;
